defs.script:

// API externe (svg embed ou inline..)
window.filterpathpanel = {
	init : function() {
		try {
			window.filterpath_init();
		} catch(ex) {alert("filterpath_ihit : " + ex);}
	},
	setTmpPath : function(v) {
		try {
			window.filterpath_setTmpPath(v);
		} catch(ex) {alert("filterpath_setTmpPath("+v+"): " + ex);}
	},
	redraw : function() {
		window.filterpath_filterPath();
	}
};
window.parent.filterpathpanel=window.filterpathpanel;
